import React from 'react'

import * as Style from "./styled";

const CategoriesItem = ({data}) => {
  return (
    <Style.CategoryWrapItem>
      <img src={data.img} alt={'categories'} />
      <div>{data.title}</div>
    </Style.CategoryWrapItem>
  )
}

export default CategoriesItem;
